Here are the step-by-step workings to calculate 40+52 in base-9:

1) In base-9, the digits are 012345678. So 40 means 4*9^1 + 0*9^0 = 36. And 52 means 5*9^1 + 2*9^0 = 47.
2) Therefore, 40 + 52 = 36 + 47 = \boxed{83}

Here are the step-by-step workings to add 38 + 85 in base-9:

38 = 3*9^1 + 8*9^0
85 = 8*9^1 + 5*9^0

Add the digits in the ones (9^0) place: 
8 + 5 = \boxed{3}

Add the digits in the tens (9^1) place:
3 + 8 = \boxed{1}

Add the carryover from the ones place (3) to the tens place:
1 + 3 = \boxed{4}

Therefore, 38 + 85 = \boxed{43}
